        try {
            return (
                Object.values(country.languages) 
            )
        } catch(err) {
            return (
              ['No languages listed']
            )
        }
    }
    console.log(languages)


    return (
        <div>
            <h1> {country.name} </h1>
            <p> Capital: {country.capital}</p>
            <p> Area: {country.area}</p>
            <h2> Languages: </h2>
            <ul>
                <p>language 1</p>
                <p>language 2</p>
                <p>language 3</p>

            </ul>
        </div>
    )
}

